const nodos=nodosString.split("\t");
function floydWarshallWithPathReconstruction(graph) {
    var dist = [];
    var parent = [];
    var n = graph.length;
    // Initialize the distance and parent matrix
    for(var i = 0; i < n; i++){
        dist[i] = [];
        parent[i] = [];
        for(var j = 0; j < n; j++){
            if(i === j) {
                dist[i][j] = 0;
                parent[i][j] = i;
            }else if(graph[i][j] !== undefined){
                dist[i][j] = graph[i][j];
                parent[i][j] = j;
            }else{
                dist[i][j] = Number.POSITIVE_INFINITY;
                parent[i][j] = null;
            }
        }
    }
    // Floyd–Warshall algorithm
    for(var k = 0; k < n; k++) {
        for(var i = 0; i < n; i++) {
            for(var j = 0; j < n; j++) {
                if(dist[i][k] + dist[k][j] < dist[i][j]){
                    dist[i][j] = dist[i][k] + dist[k][j];
                    parent[i][j] = parent[i][k];
                }
            }
        }
    }
    return { dist: dist, parent: parent };
}
function reconstructPath(inicio, final, parent) {
    var i=nodos.indexOf(inicio);
    var j=nodos.indexOf(final);
    var path = [i];
    while (i !== j) {
      i = parent[i][j];
      path.push(i);
    }
    path.map((item,index)=>{
        path[index]=nodos[item];
    })
    return path;
}
